import React from 'react';
import './Crops.css';
import NewsAds from './Leftads/adsection';
import RightNewsAds from './rightadscomonent';
import NewsHeadlines from './headlines';
import { Outlet } from 'react-router-dom';

const Crops = () => {
    return (
        <div className='layout'>
     
            <div className='left-ads'>
                <NewsAds />
            </div>
            <div className="Crops-content">
            <div className='Crops img'>
                <Outlet />
                <img src="https://i0.wp.com/rythurajyam.com/wp-content/uploads/2020/12/featured.jpg?resize=900%2C400&ssl=1" alt="Crops" className="Crops-image" />
                <h2 class="entry-title">మిరప సాగు విధానం – Chilli Cultivation in Telugu</h2>
            </div>
            </div>
            <div className="right-ads layout1">
                <RightNewsAds />
            </div>

            <div className='news'>
                <NewsHeadlines />
            </div>
        </div>
    
);
};

export default Crops;
